double natural_log(double x) 
{
    if (x <= 0) 
        return -1; 

    double result = 0.0;
    double term = (x - 1) / (x + 1);
    double term_squared = term * term;
    double numerator = term;
    int n = 1;

    while (n < 1000) 
    { 
        result += numerator / n;
        numerator *= term_squared;
        n += 2;
    }

    return 2 * result;
}

double log_base_10(double x) 
{
    double ln_x = natural_log(x);
    double ln_10 = natural_log(10.0);

    return ln_x / ln_10;
}

